import React from "react";
import "../stylesheet/layout/maincontainer1";

function CardPreview() {
  return (
    <div className="maincontainer1__profilecard">
      <div className="maincontainer1__text js-headerpreview">
        <h2 className="maincontainer1__title js-name">{props.name || "Nombre apellido"}</h2>
        <h3 className="maincontainer1__subtitle js-job">{props.job || "Front-end developer"}</h3>
      </div>
      <div className="maincontainer1__img js__profile-preview js__border-palette"></div>

    </div>
  );
}

export default CardPreview;
